import React from 'react';

const PlayerList = () => {
    const [values, setValues] = React.useState(['', '', '', '', '', '', '', '', '']);

    const handleChange = (event, index) => {
        const newValues = [...values];
        newValues[index] = event.target.value;
        setValues(newValues);
    };

    console.log(values)
    return (
        <div style={{ margin: '50px' }}>
            <h2>Player List for Game</h2>
            <p>Start Time: 8pm</p>
            <p>Time: 840pm - 10:10pm</p>
            <h2>Team Black</h2>
            <ol>
                <label>Goalie</label>
                <li style={{ margin: '10px', listStyle: 'none' }}>
                    <input type='text' onChange={(event) => handleChange(event, 0)} value={values[0]} />
                </li>
                {Array.from({ length: 8 }, (_, index) => (
                    <li key={index} style={{ margin: '10px' }}>
                        <input type='text' onChange={(event) => handleChange(event, index + 1)} value={values[index + 1]} />
                    </li>
                ))}
            </ol>

            <h2>Team White</h2>
            <ol>
                <label>Goalie</label>
                <li style={{ margin: '10px', listStyle: 'none' }}>
                    <input type='text' onChange={(event) => handleChange(event, 9)} value={values[9]} />
                </li>
                {Array.from({ length: 8 }, (_, index) => (
                    <li key={index} style={{ margin: '10px' }}>
                        <input type='text' onChange={(event) => handleChange(event, index + 10)} value={values[index + 10]} />
                    </li>
                ))}
            </ol>

            {/* stars of series */}
            <h3>Stars of the series</h3>
            <ol>
                {Array.from({ length: 3 }, (_, index) => (
                    <li key={index} style={{ margin: '10px' }}>
                        <input type='text' onChange={(event) => handleChange(event, index + 18)} value={values[index + 18]} />
                    </li>
                ))}
            </ol>

            <p>Team white winner of series</p>
        </div>
    );
};

export default PlayerList;
